import React from "react";
import mascote3 from "../img/macaco-caolho-mascote3.png";
import { Container } from "@material-ui/core";
import Paper from "@material-ui/core/Paper";
import Grid from "@material-ui/core/Grid";

class Header extends React.Component {
  render() {
    return (
      <Grid>
        <Grid item xs={12}>
          <Paper className="welcome" component="h1">
            Macaco Caolho
          </Paper>
          <Paper className="welcome" component="h1">
            Rock'n Drinks
          </Paper>
        </Grid>
        <Grid item xs={12}>
          <Paper className="ImgHead" component="img">
            {mascote3}
          </Paper>
        </Grid>
      </Grid>
    );
  }
}
export default Header;
